/**
 * 取消队列
 * @param {Object} instance 文件上传实例
 */function cancelQueue(b){document.getElementById(b.customSettings.cancelButtonId).disabled=!0;b.stopUpload();var c;do c=b.getStats(),b.cancelUpload();while(0!==c.files_queued)}function fileDialogStart(){}function fileQueued(b){try{var c=new FileProgress(b,this.customSettings.progressTarget);c.setStatus("\u7b49\u5019\u4e0a\u4f20...");c.toggleCancel(!0,this)}catch(d){this.debug(d)}}function fileQueueError(b,c,d){try{if(c===SWFUpload.QUEUE_ERROR.QUEUE_LIMIT_EXCEEDED)sw.toast("\u4e0a\u4f20\u6587\u4ef6\u8d85\u8fc7\u9884\u5b9a\u6570\u91cf\uff08"+this.getSetting("file_upload_limit")+"\u4e2a\uff09\u3002","warning",3E3);else{var a=new FileProgress(b,this.customSettings.progressTarget);a.setError();a.toggleCancel(!1);switch(c){case SWFUpload.QUEUE_ERROR.FILE_EXCEEDS_SIZE_LIMIT:a.setStatus("\u6587\u4ef6\u8d85\u8fc7 "+uploadPicMaxSize+" KB\uff0c\u7981\u6b62\u4e0a\u4f20");break;case SWFUpload.QUEUE_ERROR.ZERO_BYTE_FILE:a.setStatus("\u65e0\u6cd5\u4e0a\u4f20\u7a7a\u6587\u4ef6");break;case SWFUpload.QUEUE_ERROR.INVALID_FILETYPE:a.setStatus("\u4e0d\u652f\u6301\u7684\u6587\u4ef6\u7c7b\u578b\uff08\u652f\u6301"+uploadPicPattern+"\uff09");break;case SWFUpload.QUEUE_ERROR.QUEUE_LIMIT_EXCEEDED:sw.toast("\u4e0a\u4f20\u6587\u4ef6\u8d85\u8fc7\u9884\u5b9a\u6570\u91cf\uff08"+this.getSetting("file_upload_limit")+"\u4e2a\uff09\u3002","warning",3E3);break;default:null!==b&&a.setStatus("\u672a\u77e5\u9519\u8bef")}}}catch(e){this.debug(e)}}function fileDialogComplete(b,c){try{0<this.getStats().files_queued&&(document.getElementById(this.customSettings.cancelButtonId).disabled=!1)}catch(d){this.debug(d)}}function uploadStart(b){try{var c=new FileProgress(b,this.customSettings.progressTarget);c.setStatus("\u5f00\u59cb\u4e0a\u4f20...");c.toggleCancel(!0,this)}catch(d){}return!0}function uploadProgress(b,c,d){try{var a=Math.ceil(c/d*100),e=new FileProgress(b,this.customSettings.progressTarget);e.setProgress(a);e.setStatus("\u6b63\u5728\u4e0a\u4f20...")}catch(f){this.debug(f)}}function uploadSuccess(b,c){try{var d=$.parseJSON(c);if("1"==d.success){var a=new FileProgress(b,this.customSettings.progressTarget);a.setComplete();a.setStatus("\u4e0a\u4f20\u5b8c\u6210")}else a=new FileProgress(b,this.customSettings.progressTarget),a.setError(),a.setStatus(d.message);a.toggleCancel(!1)}catch(e){this.debug(e)}}function uploadComplete(b){try{0===this.getStats().files_queued?(document.getElementById(this.customSettings.cancelButtonId).disabled=!0,refresh()):this.startUpload()}catch(c){this.debug(c)}}function uploadError(b,c,d){try{var a=new FileProgress(b,this.customSettings.progressTarget);a.setError();a.toggleCancel(!1);switch(c){case SWFUpload.UPLOAD_ERROR.HTTP_ERROR:a.setStatus("\u4e0a\u4f20\u9519\u8bef: "+d);break;case SWFUpload.UPLOAD_ERROR.MISSING_UPLOAD_URL:a.setStatus("\u914d\u7f6e\u9519\u8bef\u3002");break;case SWFUpload.UPLOAD_ERROR.UPLOAD_FAILED:a.setStatus("\u4e0a\u4f20\u5931\u8d25\u3002");break;case SWFUpload.UPLOAD_ERROR.IO_ERROR:a.setStatus("\u670d\u52a1\u5668IO\u5f02\u5e38\u3002");break;case SWFUpload.UPLOAD_ERROR.SECURITY_ERROR:a.setStatus("\u5b89\u5168\u7981\u6b62\u3002");break;case SWFUpload.UPLOAD_ERROR.UPLOAD_LIMIT_EXCEEDED:a.setStatus("\u4e0a\u4f20\u53d7\u9650\u3002");break;case SWFUpload.UPLOAD_ERROR.SPECIFIED_FILE_ID_NOT_FOUND:a.setStatus("\u6587\u4ef6\u672a\u627e\u5230\u3002");break;case SWFUpload.UPLOAD_ERROR.FILE_VALIDATION_FAILED:a.setStatus("\u9519\u8bef\u7684\u9a8c\u8bc1\u65b9\u5f0f\uff0c\u4e0a\u4f20\u8df3\u8fc7\u3002");break;case SWFUpload.UPLOAD_ERROR.FILE_CANCELLED:0===this.getStats().files_queued&&(document.getElementById(this.customSettings.cancelButtonId).disabled=!0);a.setStatus("\u5df2\u53d6\u6d88");a.setCancelled();break;case SWFUpload.UPLOAD_ERROR.UPLOAD_STOPPED:a.setStatus("\u5df2\u505c\u6b62");break;default:a.setStatus("\u672a\u80fd\u6355\u83b7\u7684\u5f02\u5e38: "+error_code)}}catch(e){this.debug(e)}};